INSERT INTO `xxbdo_estandares` (`id`, `xxbdo_version_estandares_id`, `tipo`, `cr_plaza`, `cr_tienda`, `estandar`, `titulo`, `orden`, `detalle`, `descripcion`, `es_visible`, `activo`, `usuario`, `ip_address`, `fecha_creacion`, `fecha_modificacion`) VALUES
('057897b2-022c-4677-bc42-e9f0c6bd2dfb', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 14, 'Ambientación y Seguridad', NULL, '- No almacenar en/ Luces/ Buenas Prácticas/ 5S+1', '1.- <b>Prohibido almacenar</b> producto y/o chaquetines en el baño. Entrada no obstruida.<br><br>\r\n2.- Tener <b>luces</b> de exterior, piso de venta y baño encendidas solo cuando sea necesario. No focos fundidos.<br><br>\r\n3.- <b>Buenas prácticas</b>. La puerta de la bodega se mantiene cerrada y se abre sólo cuando es necesario. No se colocan productos u objetos encima de equipos eléctricos y de cómputo (si aplica), en el techo del cuarto frío o conservadores de hielo en bolsa. Tableros eléctricos y de control, extintores, salidas de emergencia, puertas de cuarto frío y de bodega libres de cualquier obstrucción.<br><br>\r\n4.- Orden. Aplicación del <b>5S + 1</b> en bodega, incluyendo el escritorio, equipo de cómputo (si aplica), rack y tarja. Los productos se encuentran acomodados en su lugar asignado en carriles delimitados y los utensilios de limpieza se colocan en el Rack de Limpieza. Nota: los productos se encuentran separados al menos 10 cm de la pared (no colocar productos sobre la línea roja) y no se apilan a más de 1.5 metros de altura (no sobrepasan la línea amarilla).', 1, 1, NULL, NULL, '2018-11-27 06:00:00', '2018-11-27 06:00:00'),
('0b2d76d9-14d1-4bda-9c93-a20ec71294ef', '13d772fa-826b-424f-802e-63da4777e33c', 'L', '10MON', '50EDI', NULL, 'Alumbrado Pasillo Lateral', 1, 'Vista Exterior', 'Verificar que el alumbrado del pasillo lateral exterior del edificio esté activo', 1, 1, NULL, NULL, '2018-10-25 05:00:00', '2018-10-25 05:00:00'),
('14c2764c-82a2-4d59-a514-3ec5a0048a22', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 19, 'Condiciones', 5, NULL, '1.- <b>Iluminación</b> de la Tienda (interior y exterior) de acuerdo a la hora del día. No focos y/o lámparas fundidos en exterior ni en piso de venta, bodega o cuarto frío. Anuncios (marquesina, paleta, cajeros automáticos), banqueta (plafón de marquesina, luces de pared y toldos) y estacionamiento (reflectores). Reflectores orientados hacia el estacionamiento. Acrílicos de luminarias limpios y en buen estado.<br><br>\r\n2.- <b>Exterior</b>: Basureros señalizados como orgánico e inorgánico (si aplica) y en buen estado. Marquesina sin golpes. Contenedor de basura en buen estado, con tapa  candado (si aplica) y sin graffitis. Plafones completos y no dañados. Teléfonos públicos con calcomanías bien adheridas y funcionando. Equipo de proveedores (hielo, agua, teléfonos públicos) sin graffiti y en buenas condiciones. Portabanner bien instalado y en  buen estado.<br><br>\r\n3.- <b>Equipo de Isla</b> (los que apliquen) y vidrio de escáner (si aplica) en buen estado. Refrigeradores en buen estado sin exceso de escarcha, sin lámparas fundidas y con puerta bien cerrada.<br><br>\r\n4.- <b>Piso de Venta y Bodega</b>: Temperatura ambiente en el piso de venta es agradable (si se cuenta con termostato o indicador de temperatura a la vista deberá marcar entre 22ºC y 26ºC).  En las Tiendas con aire acondicionado la puerta de acceso a la Tienda se encuentra cerrada y sólo se abre cuando entra y sale gente. Paletero sin exceso de escarcha de hielo, con rejillas despejadas, exterior en  buen estado y con calcomanías bien pegadas. Cajero automático y/o caseta telefónica (si aplican) operando correctamente y limpios. Parrilla de Punto Frío sin polvo o pelusa. Máquinas de Fast Food bebidas (café grano, frappé, capuchino) operando correctamente de acuerdo a la guía rápida de operación. Equipo de comida rápida en buen estado y termómetro (si aplica) funcionando. Máquina de hielo (si aplica en la plaza) operando correctamente, sin goteras, fugas y filtraciones de agua, depósito de hielo funcionando y limpio. Hielera de cerveza sin óxido, manchas, en  buen estado (sin roturas o decoloración), incluyendo estructura, tapas, desagüe y cubetas de desagüe. Equipo de aire acondicionado en  buen estado. Nota: los paleteros, equipos eléctricos o transformadores se encuentran separados al menos 10 cm de la pared u otros objetos. Sin reguladores de voltaje en piso de venta. Góndola mercancías generales (Novelty) o exhibidor pentagonal exhibido en piso de venta de acuerdo al layout de tienda , en buen estado, limpio y con su material POP instalado. Mobiliario de madera en buen estado. Bomba de agua funcionando. Equipo de cómputo en bodega (si aplica) instalado correctamente con base en lo definido. Paredes, ventanas, extractores, plafones y rejilla de aire acondicionado limpios y en buen estado Plafones no rotos o dañados, ni huecos en el techo por falta del mismo. Góndolas en  buen estado  y no despintadas. Pisos no quebrados, despostillados o manchados. Puerta principal en buen estado operando correctamente. Sin manchas por filtraciones en paredes ni goteras en el techo. Mesas/barras y bancos/sillas de Comida Rápida en buen estado. Sin restos de alimentos, basura o  insectos/fauna en el área de comida y Tienda. Con certificado de fumigación vigente. Puerta de bodega en buen estado cerrando correctamente, con cubre polvos y sin huecos o aberturas en sus lados. Sin mercancía, equipo o productos en la parte superior del Cuarto Frío.  Tarja y pileta limpia y en buen estado. Disponibilidad de agua para la operación. Drenaje y fosa séptica de la Tienda en buen estado, sin tuberías o coladeras abiertas y expuestas. Ventanas o rejillas de bodega con malla protectora. Sin huecos en las paredes e instalaciones eléctricas.<br><br>\r\n5.- Refrigerador de hielo \"del proveedor\" (la perilla debe encontrarse en el punto medio del rango del termostato). En Cuarto Frío, (incluyendo cámaras de hielo), la temperatura está dentro de rango establecido, verificar que los difusores estén libres de hielo. Verificar que no haya ruido excesivo o fuera de lo normal en los motores, ni fugas de aire  o agua en las cámaras. Al abrir completamente las puertas se mantienen abiertas; en caso contrario deben cerrarse por sí mismas a \"presión\" (que cierren \"de regreso\"). Puertas no desniveladas.  Empaques de las puertas en buen estado. Existencia de cortina de PVC (hawaiana) limpia y en buen estado. En caso de contar con máquina de hielo que esté en buen estado, la puerta debe permanecer cerrada cuando no se utilice y las rejillas de ventilación despejadas. Parrillas y deslizadores en buen estado. Parrillas no oxidadas. Sólo exhibidores y productos autorizados para el cuarto frío. Nota: no colocar cartones, acrílicos o algún otro material en las parrillas. Productos ordenados (apilados a una distancia mínima de 40 cms. de las parrillas y difusores). Las parrillas tienen la inclinación correcta (multiempaque cero inclinación, productos chicos nivel 2, productos medianos nivel 1 o 2 y productos grandes nivel 1). En parrillas combinadas se usa el acrílico y la inclinación del producto más grande.  Aplicación del 5S + 1 en cuarto frío.<br><br>\r\n6.- <b>Baños</b> de Empleados y Públicos, Inodoro, mingitorio, lavamanos, porta rollo, papel para secar las manos y jabonera, funcionando y en óptimas condiciones (sin fuga de agua, roturas, astillados, quebrados). Inodoro con asiento de acuerdo al tamaño y forma del inodoro, no roto, y funcionando correctamente. Piso no quebrado ni despostillado. Puerta de acceso y/o puerta de baño operando correctamente y funcionando la chapa y el seguro.', 1, 1, NULL, NULL, '2018-10-22 05:00:00', '2018-10-22 05:00:00'),
('1611a8be-fca2-4d9b-ba5e-010915372afe', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 10, 'Comida rápida', NULL, '- Estándares FF/ Insumos/ Caducidad/ Limpios/ Limpieza del área/ Utensilios', 'Todos los conceptos de <b>Fast Food Alimentos y Bebidas</b> que aplican para la tienda se ejecutan según lo definido en base al <b>Anexo a Estándares de Fast Food</b>.<br><br>\r\n1.- Todos los equipos de Fast Food limpios interna y externamente, con vestido y piezas completas y en buen estado.<br><br>\r\n2.- <b>Limpieza</b> del piso, panel duela (si aplica), muebles de comida rápida y café. Botes de basura con bolsa no más de 3/4 de su capacidad y señalizados como Orgánico e Inorgánico, con bolsa blanca para Inorgánico y negra para Orgánico (si aplica). Área libre de malos olores.<br><br>\r\n3.- <b>Utensilios</b> disponibles, limpios y en buen estado.', 1, 1, NULL, NULL, '2018-10-18 00:00:00', '2018-10-18 00:00:00'),
('1ed61000-e188-4729-ab39-a21595dee5e0', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 3, 'Control', NULL, '- Preinventarios /Efectivo /Merma /Devolución', '1.- <b>Preinventarios</b> según Rol definido, utilizando plantillas y enfocados según programa a los artículos de mayor faltante, artículos en promoción, eliminación de artículos frecuentes, y de alto valor. Mínimo 2,500 conteos por semana y al menos 40% de cobertura.<br><br>\r\n2.- Se realizan las entregas de turnos y cierre de caja cuadrando el <b>efectivo</b>, se realizan arqueos y se mantiene un control exacto. La tómbola no está obstruida. Retiros de efectivo según los montos establecidos en la Plaza, se depositan de inmediato en tómbola y se cumple con el llenado del Control de Depósitos. Se cuenta con la papelería necesaria para la entrega de valores (papeletas, bolsas) y la entrega se asegura contra el catálogo de custodios. Se mantiene la morralla adecuada para dar servicio a nuestros clientes (fondo fijo).<br><br>\r\n3.- <b>Merma</b> bajo control. Los productos a mermar están en una bolsa de plástico en el contenedor de merma autorizado en el cuarto frío, capturados en la pre-merma.<br><br>\r\n4.- Los productos con <b>devolución</b> autorizada a Cedis y proveedores, se almacenan en el contenedor  de devoluciones y/o lugar definido por el Asesor una vez aplicada la devolución en sistema. Las devoluciones a IMMEX son del 1 al 15 y se entregan en presencia del vendedor.', 1, 1, NULL, NULL, '2018-11-27 06:00:00', '2018-11-27 06:00:00'),
('2419f224-6ac7-440d-b32d-3d172ecbdbca', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 5, 'Manejo de gente', NULL, '- 2XTurno /Nuevo con Líder/ Hora salida/ Vacaciones /Balanceo /Descanso /Plan horario / Alimentación /Cargas de Trabajo/ Tarjeta bancaria', '1.- Contar con mínimo <b>dos empleados por turno</b>, incluyendo al Líder de Tienda.<br><br>\r\n2.- <b>Acompañamiento</b> del Líder de Tienda a empleados nuevos en los primeros 15 días.<br><br>\r\n3.- <b>Salida</b> de turno a tiempo.<br><br>\r\n4.- Cumplir con el rol anual de <b>vacaciones</b>.<br><br>\r\n5.- <b>Balanceo</b> de asignación de tareas (Sem 1 60% ; Sem 2 65% ; Sem 3 70%  y  Sem 4 75%. ) y/o ATA´s <font color=red>especiales</font>.<br><br>\r\n6.- <b>Descanso</b> semanal.<br><br>\r\n7.- <b>Plan horario</b> acordado previo al inicio de la semana, considerando en lo posible temas del personal.  En el corcho y firmado por los empleados. Se cuenta con un tiempo para tomar los alimentos (sin Chaquetín).<br><br>\r\n8.- <font color=red>Se respeta horario establecido para <b>alimentación</b></font>.<br><br>\r\n9.- <b>Cargas de trabajo</b> buscando balance.<br><br>\r\n10.- Se paga a tiempo y completo (tiempos extras, días festivos , etc.), mediante <b>tarjeta bancaria</b> proporcionada por plaza.', 1, 1, NULL, NULL, '2018-10-18 00:00:00', '2018-10-18 00:00:00'),
('284261a5-2388-40f9-aa82-8fe5ecd6ed88', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 19, 'Condiciones', 5, NULL, '1.- <b>Iluminación</b> de la Tienda (interior y exterior) de acuerdo a la hora del día. No focos y/o lámparas fundidos en exterior ni en piso de venta, bodega o cuarto frío. Anuncios (marquesina, paleta, cajeros automáticos), banqueta (plafón de marquesina, luces de pared y toldos) y estacionamiento (reflectores). Reflectores orientados hacia el estacionamiento. Acrílicos de luminarias limpios y en buen estado.<br><br>\r\n2.- <b>Exterior</b>: Basureros señalizados como orgánico e inorgánico (si aplica) y en buen estado. Marquesina sin golpes. Contenedor de basura en buen estado, con tapa  candado (si aplica) y sin graffitis. Plafones completos y no dañados. Teléfonos públicos con calcomanías bien adheridas y funcionando. Equipo de proveedores (hielo, agua, teléfonos públicos) sin graffiti y en buenas condiciones. Portabanner bien instalado y en  buen estado.<br><br>\r\n3.- <b>Equipo de Isla</b> (los que apliquen) y vidrio de escáner (si aplica) en buen estado. Refrigeradores en buen estado sin exceso de escarcha, sin lámparas fundidas y con puerta bien cerrada.<br><br>\r\n4.- <b>Piso de Venta y Bodega</b>: Temperatura ambiente en el piso de venta es agradable (si se cuenta con termostato o indicador de temperatura a la vista deberá marcar entre 22ºC y 26ºC).  En las Tiendas con aire acondicionado la puerta de acceso a la Tienda se encuentra cerrada y sólo se abre cuando entra y sale gente. Paletero sin exceso de escarcha de hielo, con rejillas despejadas, exterior en  buen estado y con calcomanías bien pegadas. Cajero automático y/o caseta telefónica (si aplican) operando correctamente y limpios. Parrilla de Punto Frío sin polvo o pelusa. Máquinas de Fast Food bebidas (café grano, frappé, capuchino) operando correctamente de acuerdo a la guía rápida de operación. Equipo de comida rápida en buen estado y termómetro (si aplica) funcionando. Máquina de hielo (si aplica en la plaza) operando correctamente, sin goteras, fugas y filtraciones de agua, depósito de hielo funcionando y limpio. Hielera de cerveza sin óxido, manchas, en  buen estado (sin roturas o decoloración), incluyendo estructura, tapas, desagüe y cubetas de desagüe. Equipo de aire acondicionado en  buen estado. Nota: los paleteros, equipos eléctricos o transformadores se encuentran separados al menos 10 cm de la pared u otros objetos. Sin reguladores de voltaje en piso de venta. Góndola mercancías generales (Novelty) o exhibidor pentagonal exhibido en piso de venta de acuerdo al layout de tienda , en buen estado, limpio y con su material POP instalado. Mobiliario de madera en buen estado. Bomba de agua funcionando. Equipo de cómputo en bodega (si aplica) instalado correctamente con base en lo definido. Paredes, ventanas, extractores, plafones y rejilla de aire acondicionado limpios y en buen estado Plafones no rotos o dañados, ni huecos en el techo por falta del mismo. Góndolas en  buen estado  y no despintadas. Pisos no quebrados, despostillados o manchados. Puerta principal en buen estado operando correctamente. Sin manchas por filtraciones en paredes ni goteras en el techo. Mesas/barras y bancos/sillas de Comida Rápida en buen estado. Sin restos de alimentos, basura o  insectos/fauna en el área de comida y Tienda. Con certificado de fumigación vigente. Puerta de bodega en buen estado cerrando correctamente, con cubre polvos y sin huecos o aberturas en sus lados. Sin mercancía, equipo o productos en la parte superior del Cuarto Frío.  Tarja y pileta limpia y en buen estado. Disponibilidad de agua para la operación. Drenaje y fosa séptica de la Tienda en buen estado, sin tuberías o coladeras abiertas y expuestas. Ventanas o rejillas de bodega con malla protectora. Sin huecos en las paredes e instalaciones eléctricas.<br><br>\r\n5.- Refrigerador de hielo \"del proveedor\" (la perilla debe encontrarse en el punto medio del rango del termostato). En Cuarto Frío, (incluyendo cámaras de hielo), la temperatura está dentro de rango establecido, verificar que los difusores estén libres de hielo. Verificar que no haya ruido excesivo o fuera de lo normal en los motores, ni fugas de aire  o agua en las cámaras. Al abrir completamente las puertas se mantienen abiertas; en caso contrario deben cerrarse por sí mismas a \"presión\" (que cierren \"de regreso\"). Puertas no desniveladas.  Empaques de las puertas en buen estado. Existencia de cortina de PVC (hawaiana) limpia y en buen estado. En caso de contar con máquina de hielo que esté en buen estado, la puerta debe permanecer cerrada cuando no se utilice y las rejillas de ventilación despejadas. Parrillas y deslizadores en buen estado. Parrillas no oxidadas. Sólo exhibidores y productos autorizados para el cuarto frío. Nota: no colocar cartones, acrílicos o algún otro material en las parrillas. Productos ordenados (apilados a una distancia mínima de 40 cms. de las parrillas y difusores). Las parrillas tienen la inclinación correcta (multiempaque cero inclinación, productos chicos nivel 2, productos medianos nivel 1 o 2 y productos grandes nivel 1). En parrillas combinadas se usa el acrílico y la inclinación del producto más grande.  Aplicación del 5S + 1 en cuarto frío.<br><br>\r\n6.- <b>Baños</b> de Empleados y Públicos, Inodoro, mingitorio, lavamanos, porta rollo, papel para secar las manos y jabonera, funcionando y en óptimas condiciones (sin fuga de agua, roturas, astillados, quebrados). Inodoro con asiento de acuerdo al tamaño y forma del inodoro, no roto, y funcionando correctamente. Piso no quebrado ni despostillado. Puerta de acceso y/o puerta de baño operando correctamente y funcionando la chapa y el seguro.', 1, 1, NULL, NULL, '2018-11-27 11:00:00', '2018-11-27 11:00:00'),
('2856b18b-d518-46c5-9530-6f4d13c9af84', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 6, 'Limpieza', NULL, '- Exterior/ Botes basura/ Isla/ Piso de Venta/ Equipamiento/ Frutero/ Baño/ Bodega/Químicos de Limpieza', '1.- <b>Exterior</b> <font color=red>en buen estado</font>. Banqueta, estacionamiento, pasillos, topes, jardinera y equipos limpios. Cajón y rampa para personas con discapacidad señalizado. Sin grafiti, lámparas limpias. Sin publicidad no autorizada. Árboles, jardineras en buen estado y pasto recortado (si aplica).<br><br>\r\n2.- Contenedor y <b>botes de basura</b> limpios con tapa, en buen estado y señalizados como Orgánico e Inorgánico, con bolsa blanca para Inorgánico y negra para Orgánico (si aplica). Bolsas con no más de 3/4 de su capacidad y área sin exceso de basura, derrames y libre de mal olor.<br><br>\r\n3.-<b>Isla</b>. El piso, los muebles y el equipo en general debe estar limpio y los cajones ordenados. Bolsas para el cliente disponibles y ordenadas. Tapete antifatiga en buen estado. Libre de volantes, <font color=red>publicidad y exhibidores no autorizados, objetos personales e información confidencial de la tienda a la vista del cliente.</font><br><br>\r\n4.- <b>Piso de venta</b> libre de bultos y cajas, mercancía solo en góndolas y exhibidores. Pisos limpios.  Tapete de entrada limpio y en buen estado. La tienda tiene un olor agradable o neutro, se encuentra libre de insectos <font color=red>y/o fauna nociva</font>.<br><br>\r\n5.- <b>Equipamiento</b>: Góndolas (cabeceras, lomo), paletero, hieleras, revisteros, exhibidores en piso de venta y racks para garrafones (incluyendo el espacio entre el piso y la base inferior de ellos) limpios.<br><br>\r\n6.- <b>Frutero</b> limpio incluyendo las charolas, sin derrames de líquidos de frutas o verduras.<br><br>\r\n7.- <b>Baño</b> con olor neutro o agradable. Inodoro, mingitorio, lavamanos, espejo, porta rollo, porta papel de manos y jabonera, paredes, piso y puerta limpios.<br><br>\r\n8.- <b>Bodega</b>. Limpieza. Tarja, paredes, piso, rack, locker y  puertas  limpios. Tener luces de bodega encendidas solo cuando sea necesario. No focos fundidos.<br><br>\r\n9.- Almacenamiento de <b>Químicos de Limpieza</b>. Los químicos de limpieza en uso deberán ser colocados en la canastilla ubicada sobre la tarja de lavado, el resto de químicos (contenedores grandes) deberán ser colocados exclusivamente en el espacio especificado (identificado con una etiqueta).', 1, 1, NULL, NULL, '2018-11-27 06:00:00', '2018-11-27 06:00:00'),
('2c43a8c8-5757-4da2-8689-19047475d673', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 17, 'Etiqueteo', NULL, '', '1.- Etiquetas actualizadas corresponde al producto exhibido y muestra el precio correcto), completamente legible (no decolorada) y no rota.\r\n2.- Si el producto es más pequeño que la etiqueta se deberá poner al menos una etiqueta para todos los frentes. Para productos de misma presentación mismo sabor se coloca al menos una etiqueta para todos los frentes.\r\n3.- Etiquetas colocadas en portaetiquetas o holders institucionales y en  buen estado. No colocar etiquetas en la rejillas frontales del koxka.\r\n4.- Preciadores del canasto, de vinos y licores, exhibidores de telefonía y tecnología colocados frente al producto que hace referencia.\r\n5.- Producto que aplique con preciador de remate oficial.\r\n6.- Productos con misma presentación pero diferente sabor, deben tener el mismo precio. \r\n7.- Productos de cerveza que apliquen con etiqueta de precio multi-unidad y su etiqueta de precios individual. Si el producto tiene solo un frente, colocar etiqueta de precio individual.', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('2dff3cf3-3e73-4f80-b7b7-81fe3cc8e5fc', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 12, 'Frutero operación y manejo del área', NULL, '', '1.- Producto en frutero se encuentran en buen estado, limpio, sin daño aparente y acomodado adecuadamente;  apto para la venta (no sobremaduro).\r\n2.- Frutero limpio incluyendo las charolas, sin derrames de líquidos de frutas o verduras.\r\n3.- Bolsas disponibles para el cliente.\r\n4.- Nunca refrigerar plátano y cebolla. Plátano se exhibe inmediatamente después de recibido.', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('30a796b4-bbd4-4d8e-9b86-8940a7b1bea9', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 3, 'Control', NULL, '- Preinventarios /Efectivo /Merma /Devolución', '1.- <b>Preinventarios</b> según Rol definido, utilizando plantillas y enfocados según programa a los artículos de mayor faltante, artículos en promoción, eliminación de artículos frecuentes, y de alto valor. Mínimo 2,500 conteos por semana y al menos 40% de cobertura.<br><br>\r\n2.- Se realizan las entregas de turnos y cierre de caja cuadrando el <b>efectivo</b>, se realizan arqueos y se mantiene un control exacto. La tómbola no está obstruida. Retiros de efectivo según los montos establecidos en la Plaza, se depositan de inmediato en tómbola y se cumple con el llenado del Control de Depósitos. Se cuenta con la papelería necesaria para la entrega de valores (papeletas, bolsas) y la entrega se asegura contra el catálogo de custodios. Se mantiene la morralla adecuada para dar servicio a nuestros clientes (fondo fijo).<br><br>\r\n3.- <b>Merma</b> bajo control. Los productos a mermar están en una bolsa de plástico en el contenedor de merma autorizado en el cuarto frío, capturados en la pre-merma.<br><br>\r\n4.- Los productos con <b>devolución</b> autorizada a Cedis y proveedores, se almacenan en el contenedor  de devoluciones y/o lugar definido por el Asesor una vez aplicada la devolución en sistema. Las devoluciones a IMMEX son del 1 al 15 y se entregan en presencia del vendedor.', 1, 1, NULL, NULL, '2018-10-18 00:00:00', '2018-10-18 00:00:00'),
('30feeb64-353c-4b9c-9db3-f477ff0f8b66', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 20, 'Seguridad y Prevención', 6, NULL, '1.-<b>Sistemas de seguridad</b> funcionando correctamente como CCTV (cámaras de seguridad), lámparas de emergencia y alarmas, así como chapas de puertas funcionando correctamente. Extintores vigentes. Existe un botiquín de primeros auxilios con producto en buen estado y completo.<br><br>\r\n2.- <b>Resguardo</b> de Productos de Alto Riesgo (paquetes de cigarros, vinos, celulares y tarjetas excedentes) en la herramienta de resguardo (jaula, bóveda o gaveta de resguardo) y exhibidor de celulares y tecnología bajo llave.<br><br>\r\n3.- No se deberán dejar paquetes de <b>cigarros</b> en cualquier otro lugar que no sea el exhibidor de cigarros.<br><br>\r\n4.- Prevención de <b>Extorsiones</b>: Ningún empleado o persona externa puede solicitar realizar transacciones electrónica (TAE, corresponsalías, etc...) vía telefónica<br><br>\r\n5.- <b>Calcomanías</b> preventivas en buen estado (número de Centro de Control, CCTV, Avisos de Privacidad, otras) en caso de que estas presenten desgaste o no se tengan en Tienda, solicitar por medio de  ATL o Protección Patrimonial.', 1, 1, NULL, NULL, '2018-11-27 11:00:00', '2018-11-27 11:00:00'),
('37de317a-1721-4206-99c1-acfb3b7e5dbf', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 5, 'Orden, limpieza y equipo de Isla', NULL, '', '1.- Libre de volantes, publicidad no autorizada, comida, merma, sillas o bancos excepto para personas contratadas con capacidades diferentes, personas de la tercera edad o mujeres embarazadas, pertenencias personales, información confidencial de la tienda a la vista del cliente, televisores, charolas de pan, personal no autorizado.\r\n2.- Orden y limpieza. El piso, los muebles y el equipo en general debe estar limpio y los cajones ordenados. Bolsas para el cliente disponibles y ordenadas. Tapete antifatiga en buen estado.\r\n3.- Servicios (lo que aplique). Boletas de sorteos de lotería en exhibición, portaboletos de autobús, llaveros para TAE, exhibidor de tecnología y telefonía disponibilidad y exhibición, seguros y disponibilidad tarjetas regalo, prepago y Saldazo que apliquen.\r\n4.- La tómbola no está obstruida.\r\n5.- Cigarrera limpia, con producto exhibido en todos sus carriles y con su respectiva comunicación de precios en cada artículo. Carriles en buen estado. \r\n6.-  Artículos de paquetería en tienda colocados en el espacio definido en el checkout (si aplica), libre de otras mercancías o utensilios.', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('3946a853-ae31-46a0-a8c5-529880a036b4', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 19, 'Abasto y rotación del producto', NULL, '', '1.- Abasto. Existencia de productos del catálogo vigente para la tienda.\r\n2.- Producto de bodega se lleva al piso de venta en caso que exista espacio en el lugar asignado en el Planograma.\r\n3.- En caso de no haber producto, rellenar el hueco con un ASLEP de la misma familia o con  el producto del lado. \r\n4.- La rotación de productos debe de basarse en \"Lo primero que entra es lo primero que sale, PEPS\", es decir, el producto más antiguo debe de estar colocado al filo de la góndola, parrillas o arriba según sea el caso. El producto más nuevo debe de estar colocado atrás de la góndola, parrillas o abajo según sea el caso.', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('3e91bb3f-3d2e-4ca7-a51d-8c7a4d244d54', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 1, 'Imagen y Comportamiento del personal de tienda', NULL, '- Presencia / Actitud / Comportamiento', '1.- <font color=red><b>Presencia impecable</b></font>, uniforme oficial de acuerdo a <font color\r\n=red>código de vestimenta</font> y gafete a la vista, botón promocional y/o de entrenamiento; gorra oficial sólo sí la Plaza lo autoriza.<br><br>\r\n2.- Mostrar una actitud de <b>servicio</b> hacia el cliente, proveedores y compañeros (optimista, proactivo, atento y servicial).<br><br>\r\n3.-No consumo de alimentos en isla, no uso de electrónicos laborando (especial cuidado al estar atendiendo al cliente).', 1, 1, NULL, NULL, '2018-10-18 00:00:00', '2018-10-18 00:00:00'),
('3fcb20ec-1b61-4d32-b6c9-a9c1937e4451', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 17, 'Etiqueteo (góndolas, exhibiciones, revistero, paleteros)', NULL, '', '1.- Etiquetas actualizadas corresponde al producto exhibido y muestra el precio correcto), completamente legible (no decolorada) y no rota.\r\n2.- Si el producto es más pequeño que la etiqueta se deberá poner al menos una etiqueta para todos los frentes. Para productos de misma presentación mismo sabor se coloca al menos una etiqueta para todos los frentes.\r\n3.- Etiquetas colocadas en portaetiquetas o holders institucionales y en  buen estado. No colocar etiquetas en la rejillas frontales del koxka.\r\n4.- Preciadores del canasto, de vinos y licores, exhibidores de telefonía y tecnología colocados frente al producto que hace referencia.\r\n5.- Producto que aplique con preciador de remate oficial.\r\n6.- Productos con misma presentación pero diferente sabor, deben tener el mismo precio. \r\n7.- Productos de cerveza que apliquen con etiqueta de precio multi-unidad y su etiqueta de precios individual. Si el producto tiene solo un frente, colocar etiqueta de precio individual.', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('44ffb3b7-34de-4f22-bb71-1a2ab47f429f', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 19, 'Abasto y rotación del producto (góndolas, exhibiciones, revistero, paleteros)', NULL, '', '1.- Abasto. Existencia de productos del catálogo vigente para la tienda.\r\n2.- Producto de bodega se lleva al piso de venta en caso que exista espacio en el lugar asignado en el Planograma.\r\n3.- En caso de no haber producto, rellenar el hueco con un ASLEP de la misma familia o con  el producto del lado. \r\n4.- La rotación de productos debe de basarse en \"Lo primero que entra es lo primero que sale, PEPS\", es decir, el producto más antiguo debe de estar colocado al filo de la góndola, parrillas o arriba según sea el caso. El producto más nuevo debe de estar colocado atrás de la góndola, parrillas o abajo según sea el caso.', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('45533e86-eb24-4f2b-9a36-1dd03111a138', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 22, 'Dinámica de Cultura', 2, NULL, '1.- Se tiene <b>Dinámica de Cultura</b> bimestral con los empleados. Se da vida y se busca la mejora en base a los dialogos sostenidos. Se logra participación de todos y se llega a acuerdos.', 1, 1, NULL, NULL, '2018-10-22 05:00:00', '2018-10-22 05:00:00'),
('4825e3f5-2f8e-44f3-963b-0d6f37ce12b9', '13d772fa-826b-424f-802e-63da4777e33c', 'L', '10MON', '50BIO', NULL, 'Respetar Horario de Venta de Alcohol', 1, 'Horarios', 'Verificar que se cumpla el horario autorizado para la venta de alcohol en la tienda', 1, 1, NULL, NULL, '2018-10-25 05:00:00', '2018-10-25 05:00:00'),
('4abf65cf-f7bf-41e5-bec1-f9993ebfe89e', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 8, 'Calidad y Condiciones del Producto', NULL, '- Limpios/ Frutero/ Caducidad/ Deterioro/ Temperatura de Equipos', '1.- Productos <b>limpios</b> y sin empaques alterados, raspados, o maltratados. (Apto para la venta).<br><br>\r\n2.- Producto en frutero se encuentran en buen estado, limpio, sin daño aparente y acomodado adecuadamente; apto para la venta (no sobremaduro).<br><br>\r\n3.- Producto dentro del límite de <b>caducidad</b> establecido en el mismo (retirar los productos un día antes de la fecha de vencimiento, a menos que tenga la leyenda \"Fresco hasta\") y los más próximos a caducar colocados al frente o más cerca del cliente. Los caducos retirarlos y colocarlos en contenedor de merma (aplica para todos los productos).En los productos que solo contengan la caducidad en mes y año, retirar el último día del mes indicado en de la etiqueta. Retirar los productos perecederos que no tengan etiqueta de caducidad.  Insumos de café y alimentos no caducos.<br><br>\r\n4.- Productos sin <b>señales de deterioro</b> como hongos o resequedad, mal olor o color.<br><br>\r\n5.-  <b>Temperatura de equipos</b>. Cámara de conservación de \"Refrescos y lácteos\" (2 a 5 ºC) o (36 - 41 °F), cámara de conservación de \"hielo\" (-10 a -7 ºC), cámara fría o \"cervecero\"  (de 0 a 2 °C)  a excepción de las siguientes plazas: (de 2 a 5 ºC)  en Obregón, Nogales, Monterrey, Saltillo, Allende, Laguna, Piedras Negras, Monclova, Culiacán, La Paz, Los Mochis, Reynosa, Laredo, Matamoros y Cd. Juárez. De ( -2 a 0 ) para plaza Mexicali . Salchichonero a una temperatura de 2 a 6 ºC o 35 a 42 °F. <font color=red>Para equipos de comida rápida consultar Anexo FF.</font>', 1, 1, NULL, NULL, '2018-11-27 06:00:00', '2018-11-27 06:00:00'),
('4f8c5072-8511-4a4f-a71b-0d4f34b25e3a', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 15, 'Herramienta de Compra /Tablero de Gestión Operativa', 1, NULL, '1.- Se monitorea diariamente las Tiras de PAFS en riesgo de desabasto, Resumen Operativo, Tira de Venta Recuperada por Exhibición y Tira de Venta Perdida Proveedor-Artículo del Tablero de Gestión Operativa, se imprimen y almacenan día / semana anterior y actual en la Carpeta Operativa y se llevan a cabo acciones para disminuirlos. El pedido se hace de acuerdo al sugerido y se aumenta en caso de ser hueco. Stocks actualizados para artículos durante el periodo promocional.  Se almacenan las compras por día y se revisan contra la hoja de arrastre de saldo diario validando compras y devoluciones.', 1, 1, NULL, NULL, '2018-10-22 05:00:00', '2018-10-22 05:00:00'),
('50fe2fab-a7e5-4ee8-931e-4e68ea3cfacf', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 4, 'Habilitación Equipo Tienda', NULL, '- Entienda /Servicios Financieros/ Estándares/  Clasificación', '1.- Equipo completo de acuerdo a tabulador, todos registrados en SADEL e IMSS, con <b>ENTIENDA completo</b>. Conocen sus beneficios así como los incentivos.<br><br>\r\n2.- <b>Servicios financieros</b> al menos un cajero habilitado por turno (aplica de 6:00 AM a 10:00 PM) usuario y contraseña sin bloqueos.  Los cajeros habilitados actualmente laboran en la tienda cuentan con la documentación personal vigente.<br><br>\r\n3.- Todos los empleados conocen y están habilitados para cumplir los <b>estándares</b> operativos.<br><br>\r\n4.- El equipo de tienda conoce y sabe su enfoque de acuerdo a su <b>clasificación</b> de líder, está comprometido con su plan de acción y saben como imprimir sus asignaciones de tareas.', 1, 1, NULL, NULL, '2018-11-27 06:00:00', '2018-11-27 06:00:00'),
('55335828-2f81-4f35-9b4e-a9a1261b38f2', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 21, 'Revisión Vertical', 1, NULL, '1.- Se tiene Revisión Vertical trimestral con cada empleado.', 1, 1, NULL, NULL, '2018-11-27 11:00:00', '2018-11-27 11:00:00'),
('5ba6d536-afbf-4400-b7b9-a84fbc26c3ff', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 1, 'Imagen y Comportamiento del personal de tienda', NULL, '- Presencia / Actitud / Comportamiento', '1.- <font color=red><b>Presencia impecable</b></font>, uniforme oficial de acuerdo a <font color\r\n=red>código de vestimenta</font> y gafete a la vista, botón promocional y/o de entrenamiento; gorra oficial sólo sí la Plaza lo autoriza.<br><br>\r\n2.- Mostrar una actitud de <b>servicio</b> hacia el cliente, proveedores y compañeros (optimista, proactivo, atento y servicial).<br><br>\r\n3.-No consumo de alimentos en isla, no uso de electrónicos laborando (especial cuidado al estar atendiendo al cliente).', 1, 1, NULL, NULL, '2018-11-27 06:00:00', '2018-11-27 06:00:00'),
('5d315324-9c16-4040-9a39-f61e41e9e459', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 4, 'Habilitación Equipo Tienda', NULL, '- Entienda /Servicios Financieros/ Estándares/  Clasificación', '1.- Equipo completo de acuerdo a tabulador, todos registrados en SADEL e IMSS, con <b>ENTIENDA completo</b>. Conocen sus beneficios así como los incentivos.<br><br>\r\n2.- <b>Servicios financieros</b> al menos un cajero habilitado por turno (aplica de 6:00 AM a 10:00 PM) usuario y contraseña sin bloqueos.  Los cajeros habilitados actualmente laboran en la tienda cuentan con la documentación personal vigente.<br><br>\r\n3.- Todos los empleados conocen y están habilitados para cumplir los <b>estándares</b> operativos.<br><br>\r\n4.- El equipo de tienda conoce y sabe su enfoque de acuerdo a su <b>clasificación</b> de líder, está comprometido con su plan de acción y saben como imprimir sus asignaciones de tareas.', 1, 1, NULL, NULL, '2018-10-18 00:00:00', '2018-10-18 00:00:00'),
('683a0142-71bb-47e3-91dd-0ca94ada963e', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 13, 'Venta Enfocada', NULL, '- Sugerir/ Servicios/ TGO', '1.- <font color=red>Preguntar si se le ofrece \"algo más\" y/o <b>sugerir</b> promociones o productos de forma constante.</font><br><br>\r\n2.- <b>Servicios</b> (lo que aplique). Portaboletos de autobús, llaveros para TAE, exhibidor de tecnología y telefonía disponibilidad y exhibición, seguros y disponibilidad tarjetas regalo, prepago y Saldazo que apliquen.<br><br>\r\n3.- Se cuenta con las metas definidas por el Asesor de Tienda para cada indicador y se captura el seguimiento diario de avance al indicador en el <b>TGO</b>. Se analiza diariamente el estatus actual de los Factores Críticos así como las gráficas de seguimiento diario y gráficas de proyección mensual en el Tablero de Gestión Operativa.', 1, 1, NULL, NULL, '2018-11-27 06:00:00', '2018-11-27 06:00:00'),
('6deaeb88-7507-473a-8fb5-f6193cd08dd2', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 7, 'Almacenamiento de Insumos y merma bajo control', NULL, '', '1.- Disponibilidad de insumos de comida rápida según aplique en plaza.\r\n2.- Condiciones de almacenamiento. Todos los insumos deben estar en su recipiente y lugar autorizado, con la exhibición definida en el anexo a estándares Fast Food y dentro de caducidad.\r\n3.- Merma bajo control. Los productos a mermar están en una bolsa de plástico en el contenedor de merma autorizado en el cuarto frío, capturados en la pre-merma. \r\n4.- Devoluciones.  Los productos con devolución autorizada a Cedis y proveedores, deberán almacenarse en el contenedor  de devoluciones y/o lugar definido por el Asesor una vez aplicada la devolución en sistema. ', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('7ac88b48-98a2-4722-8376-de5af32dcb3a', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 3, 'Atención en caja, venta sugerida y PRO (Protocolo de Servicio)', NULL, '', 'Con actitud de servicio:\r\n1.- Mencionar al cliente el monto total recibido para efectuar el cobro, así como el cambio que se devuelve (en caso de que el cajero recibe billetes), se entrega el ticket y lo que aplique (voucher, tae, tarjeta con la que se realizó el pago, seguro y/o comanda de ¡O´Sabor!) en la mano del cliente.\r\n2.- Generar y entregar la factura cuando el cliente lo solicite (verificando que los datos son correctos) e informarle que una vez generada la factura en tienda sólo podrá generar el archivo XML en el portal web.\r\n3.- Sugerir productos de forma constante en base a promociones o productos que puedan acompañar la compra, preguntar si se le ofrece \"algo más\".  En caso de que el cliente lleve ¡O´Sabor!, ofrecer promoción relacionada.  \r\n4.- Preguntar al cliente si desea redondear (PRO) y mencionar la institución beneficiada en caso de que pregunte.\r\n5.- Negar la venta de alcohol y/o cigarros a menores de edad o fuera del horario permitido por la ley, ante la duda de la edad del cliente, solicitar Identificación Oficial.\r\n6.- Informar el monto a pagar incluyendo comisión previo a marcar el recibo. Ofrecer empacar el producto comprado, en su caso, servicio al auto para productos pesados.\r\n7.- Agradecer la compra y/o despedirse amablemente y/o invitar al  cliente a regresar de nuevo.', 1, 1, NULL, '127.0.0.1', '2018-08-02 10:00:00', '2018-08-02 10:00:00'),
('825f0ac3-402d-4945-9fcb-da7cce59a2e6', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 9, 'Etiqueteo', NULL, '- Actualizadas/ Etiqueta varios frentes/ Colocadas/ Preciadores/ Remate/ Mismo Precio/ Cerveza', '1.- <b>Etiquetas actualizadas</b> corresponde al producto exhibido y muestra el precio correcto, completamente legible (no decolorada) y no rota.<br><br>\r\n2.- Si el producto es más pequeño que la etiqueta ó los productos son de la misma presentación mismo sabor se coloca al menos <b>una etiqueta para todos los frentes.</b><br><br>\r\n3.- Etiquetas <b>colocadas</b> en porta etiquetas o holders institucionales y <font color=red>ambos en</font> buen estado. No colocar etiquetas en la rejillas frontales del koxka.<br><br>\r\n4.- <b>Preciadores</b> del canasto, de vinos y licores, exhibidores de telefonía y tecnología colocados frente al producto que hace referencia.<br><br>\r\n5.- Producto que aplique con preciador de <b>remate</b> oficial.<br><br>\r\n6.- Productos con misma presentación pero diferente sabor, deben tener el <b>mismo precio</b>.<br><br>\r\n7.- Productos de <b>cerveza</b> que apliquen con etiqueta de precio multi-unidad y su etiqueta de precios individual. Si el producto tiene solo un frente, colocar etiqueta de precio individual.', 1, 1, NULL, NULL, '2018-11-27 06:00:00', '2018-11-27 06:00:00'),
('833deccd-8072-4c5d-971c-1db319d85e46', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 15, 'Orden, limpieza e iluminación de bodega', NULL, '', '1.- Limpieza. Tarja, paredes, piso, rack, locker y  puertas  limpios.\r\n2.- Buenas prácticas. La puerta de la bodega se mantiene cerrada y se abre sólo cuando es necesario. No se colocan productos u objetos encima de equipos eléctricos y de cómputo (si aplica), en el techo del cuarto frío o conservadores de hielo en bolsa. Tableros eléctricos y de control, extintores, salidas de emergencia, puertas de cuarto frío y de bodega libres de cualquier obstrucción.\r\n3.- Orden. Aplicación del 5S + 1 en bodega, incluyendo el escritorio, equipo de cómputo (si aplica), rack y tarja. Los productos se encuentran acomodados en su lugar asignado en carriles delimitados y los utensilios de limpieza se colocan en el Rack de Limpieza. Nota: los productos se encuentran separados al menos 10 cm de la pared (no colocar productos sobre la línea roja) y no se apilan a más de 1.5 metros de altura (no sobrepasan la línea amarilla).\r\n4.- Tener luces de bodega encendidas solo cuando sea necesario. No focos fundidos.\r\n5.- Almacenamiento de Químicos de Limpieza. Los químicos de limpieza en uso deberán ser colocados en la canastilla ubicada sobre la tarja de lavado, el resto de químicos (contenedores grandes) deberán ser colocados exclusivamente en el espacio especificado para su almacenamiento (identificado con una etiqueta).', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('86a237f2-891b-4bda-8c0e-8dcfe4c750e9', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 6, 'Limpieza del área de comida rápida', NULL, '', '1.- Todos los equipos de Fast Food limpios interna y externamente, con vestido y piezas completas y en buen estado. \r\n2.- Limpieza del piso, panel duela (si aplica), muebles de comida rápida y café. Botes de basura con bolsa no más de 3/4 de su capacidad y señalizados como Orgánico e Inorgánico, con bolsa blanca para Inorgánico y negra para Orgánico (si aplica). Área libre de malos olores. \r\n3.- Utensilios disponibles, limpios y en buen estado.', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('876cb735-47d2-4ecb-b19f-dc93cb1de4b8', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 11, 'Exhibición del producto y hielo en Hieleras', NULL, '', '1.- El producto es exclusivo de Cuauhtémoc Moctezuma y ocupa al menos el 50% de la capacidad total de la hielera, excepto viernes, sábado y domingo que debe ocupar el 100% y se exhibe de acuerdo al Planograma. Las botellas se exhiben acostadas y encontradas, las latas en posición vertical a excepción de la capa superior que está acostada, ambas con la marca hacia arriba. La cerveza cumple con el estándar de \"Frescura\" (no más de 180 días después de la fecha de envasado y dentro de la fecha de caducidad).', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('88e1079d-1f9f-4ad6-a7f2-6bd43d18e377', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 12, 'Promociones', NULL, '- Promoxxo/ Oficial/ Vigente/ No Cinta Adhesiva', '1.- Exhibiciones de Piso, Checkout, cabeceras, tiras promocionales  y adicionales con producto de acuerdo al <b>planograma</b> en Promoxxo.<br><br>\r\n2.- El material que se encuentre en tienda debe de ser el <b>oficial</b> y estar <b>vigente</b>.<br><br>\r\n3.- Los materiales <b>POP</b> deben de estar colocados/desplegados correctamente (de acuerdo a  Promoxxo), en buenas condiciones, visibles y sin obstrucciones.<br><br>\r\n4.- Todos los materiales deberán estar pegados con la cinta doble cara que trae el material, en los marcos donde corresponden o colgados con cinchos <font color=red>ó ventosas</font> si es que aplican. <b>Ningún material debe tener cinta adhesiva</b>, ni grapas.', 1, 1, NULL, NULL, '2018-10-18 00:00:00', '2018-10-18 00:00:00'),
('8ffddbe0-ea59-4a60-a923-2ee04410c147', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 10, 'Limpieza general', NULL, '', '1.- Pisos limpios.\r\n2.- Tapete de entrada limpio y en buen estado.\r\n3.- La tienda tiene un olor agradable o neutro, se encuentra libre de insectos. \r\n4.- Equipamiento: Góndolas (cabeceras, lomo), paletero, hieleras, revisteros, exhibidores generales en el área de piso de venta y racks para garrafones (incluyendo el espacio entre el piso y la base inferior de ellos) limpios. \r\n5.- Piso de venta libre de bultos y cajas, mercancía solo en góndolas y exhibidores.', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('979900d9-18c1-48bd-a417-c70216ab3e6b', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 18, 'Ejecución de Planogramas y espacios de expulsión (góndolas, exhibiciones, revistero, paleteros)', NULL, '', '1.- Los planogramas tienen la misma ubicación y tamaño que el mapa de Legos de la Tienda.\r\n2.- Los productos colocados como indica la tira de planograma o Promoxxo.\r\n3.- El producto sale libremente al ser tomado por el cliente.\r\n4.- Los productos ubicados en la charola superior no sobrepasan 10cm del límite de altura de la góndola. Para botanas, abarrotes, vinos y bebidas el limite máximo es 20cm de altura.\r\n5.- Los productos colocados al filo de la góndola, parrillas o charolas de exhibidores de piso fijos y acomodados con la marca del producto viendo hacia al frente o vista arriba según sea el caso.\r\n6.- Los productos indicados en la de tira ASLEP están ubicados en charolas de expulsión, exhibidores de remate o mueble definidos por la plaza en piso de venta. Todo articulo que no se pueda colocar deberá tener un folio generado. \r\n7.- Existe el formato de responsable por Lego evaluado correctamente en el corcho operativo. ', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('a283eab0-2172-42ad-a824-e6642a3a4879', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 20, 'Seguridad y Prevención', 6, NULL, '1.-<b>Sistemas de seguridad</b> funcionando correctamente como CCTV (cámaras de seguridad), lámparas de emergencia y alarmas, así como chapas de puertas funcionando correctamente. Extintores vigentes. Existe un botiquín de primeros auxilios con producto en buen estado y completo.<br><br>\r\n2.- <b>Resguardo</b> de Productos de Alto Riesgo (paquetes de cigarros, vinos, celulares y tarjetas excedentes) en la herramienta de resguardo (jaula, bóveda o gaveta de resguardo) y exhibidor de celulares y tecnología bajo llave.<br><br>\r\n3.- No se deberán dejar paquetes de <b>cigarros</b> en cualquier otro lugar que no sea el exhibidor de cigarros.<br><br>\r\n4.- Prevención de <b>Extorsiones</b>: Ningún empleado o persona externa puede solicitar realizar transacciones electrónica (TAE, corresponsalías, etc...) vía telefónica<br><br>\r\n5.- <b>Calcomanías</b> preventivas en buen estado (número de Centro de Control, CCTV, Avisos de Privacidad, otras) en caso de que estas presenten desgaste o no se tengan en Tienda, solicitar por medio de  ATL o Protección Patrimonial.', 1, 1, NULL, NULL, '2018-10-22 05:00:00', '2018-10-22 05:00:00'),
('a7d6420e-eba0-4261-a3e4-8db1ae1b5912', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 14, 'Ambientación y Seguridad', NULL, '- No almacenar en/ Luces/ Buenas Prácticas/ 5S+1', '1.- <b>Prohibido almacenar</b> producto y/o chaquetines en el baño. Entrada no obstruida.<br><br>\r\n2.- Tener <b>luces</b> de exterior, piso de venta y baño encendidas solo cuando sea necesario. No focos fundidos.<br><br>\r\n3.- <b>Buenas prácticas</b>. La puerta de la bodega se mantiene cerrada y se abre sólo cuando es necesario. No se colocan productos u objetos encima de equipos eléctricos y de cómputo (si aplica), en el techo del cuarto frío o conservadores de hielo en bolsa. Tableros eléctricos y de control, extintores, salidas de emergencia, puertas de cuarto frío y de bodega libres de cualquier obstrucción.<br><br>\r\n4.- Orden. Aplicación del <b>5S + 1</b> en bodega, incluyendo el escritorio, equipo de cómputo (si aplica), rack y tarja. Los productos se encuentran acomodados en su lugar asignado en carriles delimitados y los utensilios de limpieza se colocan en el Rack de Limpieza. Nota: los productos se encuentran separados al menos 10 cm de la pared (no colocar productos sobre la línea roja) y no se apilan a más de 1.5 metros de altura (no sobrepasan la línea amarilla).', 1, 1, NULL, NULL, '2018-10-18 00:00:00', '2018-10-18 00:00:00'),
('a7e36fa8-19fb-40a5-a4e8-9c5b671a339d', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 23, 'Rituales de Gestión', 3, NULL, '1.- <b>Asesor-Líder de Tienda</b> se coordinan acciones con enfoque al incremento de Ventas de la Plaza con el apoyo de los Asesores Tienda, así como también la revisión de proyectos e iniciativas de la Plaza.<br><br>\r\n2.- <b>Líder-Equipo de Tienda</b> se están realizando de forma constante revisando oportunidades y generando plan de acción. \r\nSe da cumplimiento, seguimiento y hay avance en el <b>plan de acción</b> de la tienda.', 1, 1, NULL, NULL, '2018-11-27 11:00:00', '2018-11-27 11:00:00');
INSERT INTO `xxbdo_estandares` (`id`, `xxbdo_version_estandares_id`, `tipo`, `cr_plaza`, `cr_tienda`, `estandar`, `titulo`, `orden`, `detalle`, `descripcion`, `es_visible`, `activo`, `usuario`, `ip_address`, `fecha_creacion`, `fecha_modificacion`) VALUES
('a9c307df-f548-4615-a8bf-c56ea37997d5', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 7, 'Exhibición', NULL, '- Mapa Legos/ Planograma/  Límite Altura/  Espacios ASLEP/  rotación de productos / Cigarrera/ Hieleras/ Paquetería', '1.- Los <b>planogramas</b> y exhibidores tienen la misma ubicación y tamaño que el <b>mapa de Legos</b> de la Tienda. <font color=red>Los productos colocados como indica la tira de planograma o PROMOXXO, frenteados y fondeados correctamente. En caso de no haber producto, rellenar el hueco con un ASLEP de la misma familia o con  el producto del lado.</font><br><br>\r\n2.- Los productos ubicados en la charola superior no sobrepasan 10cm del <b>límite de altura</b> de la góndola. Para botanas, abarrotes, vinos y bebidas el limite máximo es 20cm de altura.<br><br>\r\n<font color=red>3.- Contar con exhibidores de piso y hieleras acorde a inventario de espacios.</font><br><br>\r\n4.- Los productos indicados en la de tira <b>ASLEP</b> están ubicados en charolas de expulsión, exhibidores de remate o mueble definidos por la plaza en piso de venta. Todo articulo que no se pueda colocar deberá tener un folio generado.<br><br>\r\n5.- La <b>rotación de productos</b> debe de basarse en \"Lo primero que entra es lo primero que sale, \"<b>PEPS</b>\".<br><br>\r\n6.- <b>Cigarrera</b> con producto exhibido en todos sus carriles y con su respectiva comunicación de precios en cada artículo. <font color=red>Cuenta con charola promocional. Carriles y copete en buen estado (si aplica).</font><br><br>\r\n7.- <b>Hieleras</b> con producto de CCM con al menos el 50% de su capacidad, excepto viernes, sábado y domingo que debe de ocupar el 100%, exhibido de acuerdo a guía de acomodo (si aplica).<br><br>\r\n8.-  Artículos de <b>paquetería</b> en tienda colocados en el espacio definido en el checkout (si aplica) y con <font color=red>calcomanía</font> especificada, libre de otras mercancías o utensilios.', 1, 1, NULL, NULL, '2018-11-27 06:00:00', '2018-11-27 06:00:00'),
('aa16fbba-8ded-406f-92ab-589e8aeea34d', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 9, 'Ejecución de Fast Food Alimentos', NULL, '', 'Todos los conceptos de fast food alimentos que aplican para la tienda se ejecutan según lo definido en el anexo a estándares fast food.', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('ab241e59-1bbc-444d-b59d-49eb768b4981', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 2, 'Atención al cliente', NULL, '- Saludo / Caja adicional / PRO // No Venta Menores / Servicio Electrónico /Agradecer/ factuar/ estacionamiento/ Horarios', '1.- Ofrecer un <b>saludo</b> y trato amable al cliente durante su estancia en la tienda, dando prioridad en atenderlo.<br><br>\r\n2.- <b>Abrir caja adicional</b> al detectar más de tres clientes en fila o si se está cobrando algún servicio financiero, boletos o facturación. Todas las cajas siempre con fondo y con morralla suficiente para recibir billetes de cualquier denominación y/o realizar retiros. Colocar letrero de \"caja cerrada\" cuando la caja no esté disponible para venta.<br><br>\r\n3.- Preguntar al cliente si desea redondear (<b>PRO</b>) y mencionar la institución beneficiada en caso de que pregunte.<br><br>\r\n4.- <b>Negar la venta de alcohol y/o cigarros</b> a menores de edad o fuera del horario permitido por la ley, ante la duda de la edad del cliente, solicitar Identificación Oficial.<br><br>\r\n5.- <font color=red>Siempre intentar realizar cualquier <b>servicio electrónico</b> antes de indicar al cliente que no hay sistema. Informar el monto a pagar incluyendo comisión por servicio.</font><br><br>\r\n6.- <b>Agradecer la compra</b> y/o despedirse amablemente y/o invitar al  cliente a regresar de nuevo.<br><br>\r\n7.- Generar y entregar la <b>factura</b> cuando el cliente lo solicite (verificando que los datos son correctos) e informarle que una vez generada la factura en tienda sólo podrá generar el archivo XML en el portal web.<br><br>\r\n8.- Mantener disponibilidad de <b>estacionamiento</b> para nuestros clientes.<br><br>\r\n9.- Cumplir con los <b>horarios de apertura y cierre de tiendas</b> de acuerdo a lo establecido por la Plaza.', 1, 1, NULL, NULL, '2018-10-18 00:00:00', '2018-10-18 00:00:00'),
('abc97793-4669-4ce7-a770-71a7fe8d764b', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 13, 'Venta Enfocada', NULL, '- Sugerir/ Servicios/ TGO', '1.- <font color=red>Preguntar si se le ofrece \"algo más\" y/o <b>sugerir</b> promociones o productos de forma constante.</font><br><br>\r\n2.- <b>Servicios</b> (lo que aplique). Portaboletos de autobús, llaveros para TAE, exhibidor de tecnología y telefonía disponibilidad y exhibición, seguros y disponibilidad tarjetas regalo, prepago y Saldazo que apliquen.<br><br>\r\n3.- Se cuenta con las metas definidas por el Asesor de Tienda para cada indicador y se captura el seguimiento diario de avance al indicador en el <b>TGO</b>. Se analiza diariamente el estatus actual de los Factores Críticos así como las gráficas de seguimiento diario y gráficas de proyección mensual en el Tablero de Gestión Operativa.', 1, 1, NULL, NULL, '2018-10-18 00:00:00', '2018-10-18 00:00:00'),
('ac74c202-e1d2-4197-a7af-7b0db73f254f', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 22, 'Dinámica de Cultura', 2, NULL, '1.- Se tiene <b>Dinámica de Cultura</b> bimestral con los empleados. Se da vida y se busca la mejora en base a los dialogos sostenidos. Se logra participación de todos y se llega a acuerdos.', 1, 1, NULL, NULL, '2018-11-27 11:00:00', '2018-11-27 11:00:00'),
('ace988e0-1735-4258-97a9-441177a7c1fe', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 21, 'Revisión Vertical', 1, NULL, '1.- Se tiene Revisión Vertical trimestral con cada empleado.', 1, 1, NULL, NULL, '2018-10-22 05:00:00', '2018-10-22 05:00:00'),
('b5bbb663-f658-4620-9142-e2a051eb2a76', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 11, 'Cuarto Frío', NULL, '- Resurtido/ Limpieza/Orden/ Exhibición Visible/ Buenas Prácticas/ Hielo/ Chamarras', '1.- <b>Resurtido</b> continuo de los producto en el cuarto frio (no más de 3 huecos visibles).<br><br>\r\n2.- <b>Limpieza</b>: Puertas, techo y marcos de cuarto frío, parrillas, deslizadores, acrílicos, porta etiquetas, puerta de acceso al cuarto frio, cortina hawaiana, piso, paredes interiores y exteriores (sin evidencia de derrames), rack y exhibidores  limpios y en buen estado.<br><br>\r\n3.- <b>Orden</b>: Pisos sin objetos tirados, barrido y trapeado, libre de malos olores. Sólo exhibidores y productos autorizados para el cuarto frío. Carriles bien definidos con acrílicos de acuerdo al tamaño. El producto apilado está dentro del limite permitido (1.5 mts. de altura). <font color=red>No se coloca producto alimenticio directamente sobre el piso.</font><br><br>\r\n4.- <b>Exhibición visible</b> e iluminada en todo momento. No lámparas fundidas.<br><br>\r\n5.- Buenas prácticas: La cortina de PVC (hawaiana) nunca se encuentra \"colgada\" o \"amarrada\". La(s) puerta(s) de acceso al cuarto frío se mantienen bien cerradas. Productos resguardados en el rack de acuerdo a la guía. Alimentos de personal de tienda en su cajonera autorizada. Aplicación del 5S + 1.<br><br>\r\n6.- Al menos el 50% de <b>existencia de  hielo</b> apto para su venta y con buena accesibilidad. No se estiba más de 1.5 m de altura. No escarcha y/o agua escurriendo en piso del contenedor.<br><br>\r\n7.- Existen 2 <b>chamarras</b> en la tienda en buen estado <font color=red>colgadas en el perchero.</font>', 1, 1, NULL, NULL, '2018-11-27 06:00:00', '2018-11-27 06:00:00'),
('b72c4498-d784-4468-b948-e88b9fe8f64a', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 21, 'Exhibición de Promociones', NULL, '', '1.- Exhibiciones de Piso, Checkout, cabeceras, tiras promocionales  y adicionales con producto de acuerdo al planograma en Promoxxo.', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('b90f7b11-a722-47a5-a04a-9e27cdf10348', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 11, 'Cuarto Frío', NULL, '- Resurtido/ Limpieza/Orden/ Exhibición Visible/ Buenas Prácticas/ Hielo/ Chamarras', '1.- <b>Resurtido</b> continuo de los producto en el cuarto frio (no más de 3 huecos visibles).<br><br>\r\n2.- <b>Limpieza</b>: Puertas, techo y marcos de cuarto frío, parrillas, deslizadores, acrílicos, porta etiquetas, puerta de acceso al cuarto frio, cortina hawaiana, piso, paredes interiores y exteriores (sin evidencia de derrames), rack y exhibidores  limpios y en buen estado.<br><br>\r\n3.- <b>Orden</b>: Pisos sin objetos tirados, barrido y trapeado, libre de malos olores. Sólo exhibidores y productos autorizados para el cuarto frío. Carriles bien definidos con acrílicos de acuerdo al tamaño. El producto apilado está dentro del limite permitido (1.5 mts. de altura). <font color=red>No se coloca producto alimenticio directamente sobre el piso.</font><br><br>\r\n4.- <b>Exhibición visible</b> e iluminada en todo momento. No lámparas fundidas.<br><br>\r\n5.- Buenas prácticas: La cortina de PVC (hawaiana) nunca se encuentra \"colgada\" o \"amarrada\". La(s) puerta(s) de acceso al cuarto frío se mantienen bien cerradas. Productos resguardados en el rack de acuerdo a la guía. Alimentos de personal de tienda en su cajonera autorizada. Aplicación del 5S + 1.<br><br>\r\n6.- Al menos el 50% de <b>existencia de  hielo</b> apto para su venta y con buena accesibilidad. No se estiba más de 1.5 m de altura. No escarcha y/o agua escurriendo en piso del contenedor.<br><br>\r\n7.- Existen 2 <b>chamarras</b> en la tienda en buen estado <font color=red>colgadas en el perchero.</font>', 1, 1, NULL, NULL, '2018-10-18 00:00:00', '2018-10-18 00:00:00'),
('bbec7143-90b9-411f-a202-ecaa0069b43b', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 16, 'Asignación de Tareas', 2, NULL, '1.- Todos los empleados cuentan con su tira en el turno. El Líder y/o Encargado monitorean diariamente la ejecución de las tareas asignadas. Al menos de manera semanal el líder revisa las tareas creadas y como están asignadas, de forma que coincidan con las áreas de oportunidad encontradas. Las cargas están entre 85% y 100%  y equilibradas, para personal nuevo de acuerdo a vector gente. Se encuentran en el corcho las tiras del último día y turnos laborados.', 1, 1, NULL, NULL, '2018-10-22 05:00:00', '2018-10-22 05:00:00'),
('bd4af773-fb08-4057-9048-1fc14a875056', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 16, 'Condiciones del producto (góndolas, exhibiciones, revistero, paleteros)', NULL, '', '1.- Productos limpios y sin empaques alterados, raspados, o maltratados. (Apto para la venta).\r\n2.- Producto dentro del límite de caducidad establecido en el mismo (retirar los productos un día antes de la fecha de vencimiento, a menos que tenga la leyenda \"Fresco hasta\") y los más próximos a caducar colocados al frente o más cerca del cliente,  y los caducos retirarlos y colocarlos en contenedor de merma (aplica para todos los productos). En los productos que solo contengan la caducidad en mes y año, retirar el último día del mes indicado en de la etiqueta. Retirar los productos perecederos que no tengan etiqueta de caducidad.\r\n3.- Productos (comida rápida) sin señales de deterioro como hongos o resequedad, mal olor o color.\r\n4.- Insumos de café y alimentos no caducos.', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('bfdc68d7-bb4b-4466-8503-08c00d672f13', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 17, 'Carpeta Operativa/ Permisos Oficiales/ Corcho Operativo', 3, NULL, '1.- Las carpeta operativa  se encuentra actualizada (aplica según lo comunicado de acuerdo a la última versión), organizada y en buenas condiciones y los puntos que se deban de llenar se llenan tal y como se definió.<br><br>\r\n2.-  Se verifica que los permisos oficiales se encuentren en tienda y vigentes, de acuerdo a la ley local vigente (visibles, donde aplique).<br><br>\r\n<font color=red>3.- Se encuentra en el corcho la tira de artículos del \"Inventario en bodega sin exhibición\" actualizada (no tiene más de 7 días desde su impresión).</font><br><br>\r\n<font color=red>4.- Existe el formato de responsable por Lego evaluado correctamente en el corcho operativo. Se agrega la tira de resumen de cambios todos los lunes.</font>', 1, 1, NULL, NULL, '2018-11-27 11:00:00', '2018-11-27 11:00:00'),
('c13af482-4c9c-4e1e-a5fd-8271b2bd78c5', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 2, 'Atención al cliente', NULL, '- Saludo / Caja adicional / PRO // No Venta Menores / Servicio Electrónico /Agradecer/ factuar/ estacionamiento/ Horarios', '1.- Ofrecer un <b>saludo</b> y trato amable al cliente durante su estancia en la tienda, dando prioridad en atenderlo.<br><br>\r\n2.- <b>Abrir caja adicional</b> al detectar más de tres clientes en fila o si se está cobrando algún servicio financiero, boletos o facturación. Todas las cajas siempre con fondo y con morralla suficiente para recibir billetes de cualquier denominación y/o realizar retiros. Colocar letrero de \"caja cerrada\" cuando la caja no esté disponible para venta.<br><br>\r\n3.- Preguntar al cliente si desea redondear (<b>PRO</b>) y mencionar la institución beneficiada en caso de que pregunte.<br><br>\r\n4.- <b>Negar la venta de alcohol y/o cigarros</b> a menores de edad o fuera del horario permitido por la ley, ante la duda de la edad del cliente, solicitar Identificación Oficial.<br><br>\r\n5.- <font color=red>Siempre intentar realizar cualquier <b>servicio electrónico</b> antes de indicar al cliente que no hay sistema. Informar el monto a pagar incluyendo comisión por servicio.</font><br><br>\r\n6.- <b>Agradecer la compra</b> y/o despedirse amablemente y/o invitar al  cliente a regresar de nuevo.<br><br>\r\n7.- Generar y entregar la <b>factura</b> cuando el cliente lo solicite (verificando que los datos son correctos) e informarle que una vez generada la factura en tienda sólo podrá generar el archivo XML en el portal web.<br><br>\r\n8.- Mantener disponibilidad de <b>estacionamiento</b> para nuestros clientes.<br><br>\r\n9.- Cumplir con los <b>horarios de apertura y cierre de tiendas</b> de acuerdo a lo establecido por la Plaza.', 1, 1, NULL, NULL, '2018-11-27 06:00:00', '2018-11-27 06:00:00'),
('c57a1176-49ec-4e29-9a52-d685e69545b2', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 22, 'Condiciones del Material POP', 5, '', '1.- El material que se encuentre en tienda debe de ser el oficial y estar vigente.\r\n2.- Los materiales POP deben de estar colocados/desplegados correctamente (de acuerdo a  Promoxxo), en buenas condiciones, visibles y sin obstrucciones. \r\n3.- Todos los materiales deberán estar pegados con la cinta doble cara que trae el material, en los marcos donde corresponden o colgados con cinchos si es que aplican. Ningún material debe tener cinta adhesiva ni grapas.', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('c9ee8725-df8f-4efb-b2b5-e8f3729cff2a', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 9, 'Etiqueteo', NULL, '- Actualizadas/ Etiqueta varios frentes/ Colocadas/ Preciadores/ Remate/ Mismo Precio/ Cerveza', '1.- <b>Etiquetas actualizadas</b> corresponde al producto exhibido y muestra el precio correcto, completamente legible (no decolorada) y no rota.<br><br>\r\n2.- Si el producto es más pequeño que la etiqueta ó los productos son de la misma presentación mismo sabor se coloca al menos <b>una etiqueta para todos los frentes.</b><br><br>\r\n3.- Etiquetas <b>colocadas</b> en porta etiquetas o holders institucionales y <font color=red>ambos en</font> buen estado. No colocar etiquetas en la rejillas frontales del koxka.<br><br>\r\n4.- <b>Preciadores</b> del canasto, de vinos y licores, exhibidores de telefonía y tecnología colocados frente al producto que hace referencia.<br><br>\r\n5.- Producto que aplique con preciador de <b>remate</b> oficial.<br><br>\r\n6.- Productos con misma presentación pero diferente sabor, deben tener el <b>mismo precio</b>.<br><br>\r\n7.- Productos de <b>cerveza</b> que apliquen con etiqueta de precio multi-unidad y su etiqueta de precios individual. Si el producto tiene solo un frente, colocar etiqueta de precio individual.', 1, 1, NULL, NULL, '2018-10-18 00:00:00', '2018-10-18 00:00:00'),
('cc038d4a-b23f-487e-a984-752c375ac131', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 1, 'Imagen y Comportamiento del personal de tienda', NULL, '', '1.- Portar uniforme oficial: En buen estado, limpio, no arrugado, cerrado y portando el gafete a la vista del cliente y el botón promocional y/o de entrenamiento; el uso de gorras oficiales sólo sí la Plaza lo autoriza. \r\n2.- Imagen personal: No tatuajes visibles, no tintes estrafalarios, cabello corto o recogido, bien peinado, calzado limpio y cerrado, pantalón o falda larga, cadenas por dentro, aretes (sólo mujeres y en orejas), no piercings, uñas recortadas y limpias, manos limpias y sin heridas expuestas. \r\n3.- De comportamiento: Siempre el cliente es primero, dirigirse con respeto a los clientes, proveedores y compañeros. No fumar, no consumir bebidas embriagantes, no mascar chicle, no escupir, no gritar, no chiflar o decir malas palabras en la tienda. No se consumen alimentos en la isla. No está permitido el uso de reproductores de música personal o dispositivos electrónicos. Mientras se atiende a un cliente no se utiliza el teléfono y/o celular.', 1, 1, NULL, '127.0.0.1', '2018-08-02 10:00:00', '2018-08-02 10:00:00'),
('ce51ac7c-d532-48d7-a4b1-2b561e902c69', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 10, 'Comida rápida', NULL, '- Estándares FF/ Insumos/ Caducidad/ Limpios/ Limpieza del área/ Utensilios', 'Todos los conceptos de <b>Fast Food Alimentos y Bebidas</b> que aplican para la tienda se ejecutan según lo definido en base al <b>Anexo a Estándares de Fast Food</b>.<br><br>\r\n1.- Todos los equipos de Fast Food limpios interna y externamente, con vestido y piezas completas y en buen estado.<br><br>\r\n2.- <b>Limpieza</b> del piso, panel duela (si aplica), muebles de comida rápida y café. Botes de basura con bolsa no más de 3/4 de su capacidad y señalizados como Orgánico e Inorgánico, con bolsa blanca para Inorgánico y negra para Orgánico (si aplica). Área libre de malos olores.<br><br>\r\n3.- <b>Utensilios</b> disponibles, limpios y en buen estado.', 1, 1, NULL, NULL, '2018-11-27 06:00:00', '2018-11-27 06:00:00'),
('cf0c9682-b517-4d69-a0e0-a13ce9aad8b7', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 18, 'Ejecución de Planogramas y espacios de explusión', NULL, '', '1.- Los planogramas tienen la misma ubicación y tamaño que el mapa de Legos de la Tienda.\r\n2.- Los productos colocados como indica la tira de planograma o Promoxxo.\r\n3.- El producto sale libremente al ser tomado por el cliente.\r\n4.- Los productos ubicados en la charola superior no sobrepasan 10cm del límite de altura de la góndola. Para botanas, abarrotes, vinos y bebidas el limite máximo es 20cm de altura.\r\n5.- Los productos colocados al filo de la góndola, parrillas o charolas de exhibidores de piso fijos y acomodados con la marca del producto viendo hacia al frente o vista arriba según sea el caso.\r\n6.- Los productos indicados en la de tira ASLEP están ubicados en charolas de expulsión, exhibidores de remate o mueble definidos por la plaza en piso de venta. Todo articulo que no se pueda colocar deberá tener un folio generado. \r\n7.- Existe el formato de responsable por Lego evaluado correctamente en el corcho operativo. ', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('d0974d54-1172-4543-8606-84413d5e5636', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 16, 'Asignación de Tareas', 2, NULL, '1.- Todos los empleados cuentan con su tira en el turno. El Líder y/o Encargado monitorean diariamente la ejecución de las tareas asignadas. Al menos de manera semanal el líder revisa las tareas creadas y como están asignadas, de forma que coincidan con las áreas de oportunidad encontradas. Las cargas están entre 85% y 100%  y equilibradas, para personal nuevo de acuerdo a vector gente. Se encuentran en el corcho las tiras del último día y turnos laborados.', 1, 1, NULL, NULL, '2018-11-27 11:00:00', '2018-11-27 11:00:00'),
('d6df5461-24dd-4034-b283-0100462d547b', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 12, 'Promociones', NULL, '- Promoxxo/ Oficial/ Vigente/ No Cinta Adhesiva', '1.- Exhibiciones de Piso, Checkout, cabeceras, tiras promocionales  y adicionales con producto de acuerdo al <b>planograma</b> en Promoxxo.<br><br>\r\n2.- El material que se encuentre en tienda debe de ser el <b>oficial</b> y estar <b>vigente</b>.<br><br>\r\n3.- Los materiales <b>POP</b> deben de estar colocados/desplegados correctamente (de acuerdo a  Promoxxo), en buenas condiciones, visibles y sin obstrucciones.<br><br>\r\n4.- Todos los materiales deberán estar pegados con la cinta doble cara que trae el material, en los marcos donde corresponden o colgados con cinchos <font color=red>ó ventosas</font> si es que aplican. <b>Ningún material debe tener cinta adhesiva</b>, ni grapas.', 1, 1, NULL, NULL, '2018-11-27 06:00:00', '2018-11-27 06:00:00'),
('d6ecde14-a46b-431e-93d7-ecbbb2bed989', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 6, 'Limpieza', NULL, '- Exterior/ Botes basura/ Isla/ Piso de Venta/ Equipamiento/ Frutero/ Baño/ Bodega/Químicos de Limpieza', '1.- <b>Exterior</b> <font color=red>en buen estado</font>. Banqueta, estacionamiento, pasillos, topes, jardinera y equipos limpios. Cajón y rampa para personas con discapacidad señalizado. Sin grafiti, lámparas limpias. Sin publicidad no autorizada. Árboles, jardineras en buen estado y pasto recortado (si aplica).<br><br>\r\n2.- Contenedor y <b>botes de basura</b> limpios con tapa, en buen estado y señalizados como Orgánico e Inorgánico, con bolsa blanca para Inorgánico y negra para Orgánico (si aplica). Bolsas con no más de 3/4 de su capacidad y área sin exceso de basura, derrames y libre de mal olor.<br><br>\r\n3.-<b>Isla</b>. El piso, los muebles y el equipo en general debe estar limpio y los cajones ordenados. Bolsas para el cliente disponibles y ordenadas. Tapete antifatiga en buen estado. Libre de volantes, <font color=red>publicidad y exhibidores no autorizados, objetos personales e información confidencial de la tienda a la vista del cliente.</font><br><br>\r\n4.- <b>Piso de venta</b> libre de bultos y cajas, mercancía solo en góndolas y exhibidores. Pisos limpios.  Tapete de entrada limpio y en buen estado. La tienda tiene un olor agradable o neutro, se encuentra libre de insectos <font color=red>y/o fauna nociva</font>.<br><br>\r\n5.- <b>Equipamiento</b>: Góndolas (cabeceras, lomo), paletero, hieleras, revisteros, exhibidores en piso de venta y racks para garrafones (incluyendo el espacio entre el piso y la base inferior de ellos) limpios.<br><br>\r\n6.- <b>Frutero</b> limpio incluyendo las charolas, sin derrames de líquidos de frutas o verduras.<br><br>\r\n7.- <b>Baño</b> con olor neutro o agradable. Inodoro, mingitorio, lavamanos, espejo, porta rollo, porta papel de manos y jabonera, paredes, piso y puerta limpios.<br><br>\r\n8.- <b>Bodega</b>. Limpieza. Tarja, paredes, piso, rack, locker y  puertas  limpios. Tener luces de bodega encendidas solo cuando sea necesario. No focos fundidos.<br><br>\r\n9.- Almacenamiento de <b>Químicos de Limpieza</b>. Los químicos de limpieza en uso deberán ser colocados en la canastilla ubicada sobre la tarja de lavado, el resto de químicos (contenedores grandes) deberán ser colocados exclusivamente en el espacio especificado (identificado con una etiqueta).', 1, 1, NULL, NULL, '2018-10-18 00:00:00', '2018-10-18 00:00:00'),
('d72e7c09-a9fa-407d-b82e-cec946340f7e', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 13, 'Limpieza, condiciones y temperatura del Cuarto Frío', NULL, '', '1.- Limpieza: Puertas, techo y marcos de cuarto frío, parrillas, deslizadores, acrílicos, portaetiquetas, puerta de acceso al cuarto frio, cortina hawaiana, piso, paredes interiores y exteriores (sin evidencia de derrames), rack y exhibidores  limpios y en buen estado.\r\n2.- Orden: Pisos sin objetos tirados, barrido y trapeado, libre de malos olores. Sólo exhibidores y productos autorizados para el cuarto frío. Carriles bien definidos con acrílicos de acuerdo al tamaño. El producto apilado está dentro del limite permitido (1.5 mts de altura).\r\n3.- Exhibición visible  e iluminada en todo momento. No lámparas fundidas.\r\n4.- Buenas prácticas: La cortina de PVC (hawaiana) nunca se encuentra \"colgada\" o \"amarrada\". La(s) puerta(s) de acceso al cuarto frío se mantienen bien cerradas. Productos resguardados en el rack de acuerdo a la guía. Alimentos de personal de tienda en su cajonera autorizada. Aplicación del 5S + 1.\r\n5.- Al menos el 50% de existencia de  hielo apto para su venta y con buena accesibilidad. No se estiba más de 1.5 m de altura. No escarcha y/o agua escurriendo en piso del contenedor.\r\n6.- Existen 2 chamarras en la tienda en buen estado.', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('d9358b5c-f6b2-41cb-b801-4e9a6b3176d4', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 23, 'Rituales de Gestión', 3, NULL, '1.- <b>Asesor-Líder de Tienda</b> se coordinan acciones con enfoque al incremento de Ventas de la Plaza con el apoyo de los Asesores Tienda, así como también la revisión de proyectos e iniciativas de la Plaza.<br><br>\r\n2.- <b>Líder-Equipo de Tienda</b> se están realizando de forma constante revisando oportunidades y generando plan de acción. \r\nSe da cumplimiento, seguimiento y hay avance en el <b>plan de acción</b> de la tienda.', 1, 1, NULL, NULL, '2018-10-22 05:00:00', '2018-10-22 05:00:00'),
('da841b3c-5634-4aac-97f0-60d949258682', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 2, 'Servicio al cliente y Rapidez (Protocolo de Servicio)', NULL, '', 'Servicio al Cliente\r\n1.- Saludar al cliente y ser amable dando prioridad para atenderlo en cualquier momento de su estancia en Tienda.\r\n2.- Mostrar una actitud de servicio hacia el cliente (optimista, proactivo, atento y servicial).  Prestar la asistencia necesaria para realizar la compra y para utilizar nuestros servicios a todos nuestras clientes. Siempre intentar realizar cualquier Servicio financiero antes de indicar al cliente que no hay sistema.\r\n3- Cumplir con los horarios de apertura y cierre de Tienda de acuerdo a lo establecido por la plaza.\r\nRapidez                                                                                                                                                                                          4.- Contar con mínimo dos empleados por turno, incluyendo al Líder de Tienda. Excepto turno nocturno si es por ventanilla. Servicios financieros al menos un cajero habilitado (ligado su usuario de corresponsalías a su número de empleado) por turno (aplica de 8:00 AM a 8:00 PM) usuario y contraseña sin bloqueos.\r\n5.- Abrir caja adicional al detectar más de tres clientes en fila o si se está cobrando algún servicio financiero, boletos, sorteos del trébol o facturación. En caso de estar realizando curso en línea se tiene que suspender y atender al cliente. Todas las cajas siempre con fondo y con morralla suficiente para recibir billetes de cualquier denominación y/o realizar retiros. Colocar letrero de \"caja cerrada\" cuando la caja no esté disponible para venta.\r\n6.- Mantener disponibilidad  de estacionamiento para nuestros clientes.', 1, 1, NULL, '127.0.0.1', '2018-08-02 10:00:00', '2018-08-02 10:00:00'),
('db734739-7025-489c-aaee-aa970ccbcc06', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 17, 'Carpeta Operativa/ Permisos Oficiales/ Corcho Operativo', 3, NULL, '1.- Las carpeta operativa  se encuentra actualizada (aplica según lo comunicado de acuerdo a la última versión), organizada y en buenas condiciones y los puntos que se deban de llenar se llenan tal y como se definió.<br><br>\r\n2.-  Se verifica que los permisos oficiales se encuentren en tienda y vigentes, de acuerdo a la ley local vigente (visibles, donde aplique).<br><br>\r\n<font color=red>3.- Se encuentra en el corcho la tira de artículos del \"Inventario en bodega sin exhibición\" actualizada (no tiene más de 7 días desde su impresión).</font><br><br>\r\n<font color=red>4.- Existe el formato de responsable por Lego evaluado correctamente en el corcho operativo. Se agrega la tira de resumen de cambios todos los lunes.</font>', 1, 1, NULL, NULL, '2018-10-22 05:00:00', '2018-10-22 05:00:00'),
('dc75f070-5fee-4150-974d-6774ebf3e71d', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 14, 'Baños de empleados y públicos', NULL, '', '1.- Limpieza: Inodoro, mingitorio, lavamanos, espejo, porta rollo, porta papel de manos y jabonera, paredes, piso y puerta limpios.\r\n2.- Bote de basura orgánico con bolsa negra y de basura inorgánico con bolsa blanca (si aplica), limpios y sin saturación de residuos.\r\n3.- Baño con olor neutro o agradable.\r\n4.- Se cuenta con papel higiénico, papel para secar las manos y jabón.\r\n5.- Prohibido almacenar producto y/o chaquetines. Entrada no obstruida.\r\n6.- Tener luces de baño encendidas solo cuando sea necesario. No focos fundidos.\r\n7.- Baños públicos disponibles para el cliente.', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('e20fe30e-aa3b-4500-bdfe-207e6d8bb10b', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 4, 'Limpieza e imagen Exterior', NULL, '', '1.- No exceso de chicles.\r\n2.- Banqueta, estacionamiento, topes y jardinera limpios y en buen estado. Cajón y rampa para personas con discapacidad señalizado y en buen estado.\r\n3.- Contenedor y botes de basura limpios con tapa, en buen estado y señalizados como Orgánico e Inorgánico, con bolsa blanca para Inorgánico y negra para Orgánico (si aplica). Bolsas con no más de 3/4 de su capacidad y área  sin exceso de basura, derrames y libre de mal olor.\r\n4.- Imagen exterior. Sin graffiti en paredes exteriores, ventanales, puertas de acceso y marcos, pintura exterior, lamparas limpios y en buen estado, sin publicidad no autorizada. Árboles, jardineras en buen estado y pasto recortado (si aplica).\r\n5.- Equipos limpios y en buen estado (hielo, teléfonos públicos, etc.).\r\n6.- Orden y Limpieza de pasillos o patios exteriores libres de cartón, canastillas, basura, mercancía, etc.', 1, 1, NULL, '127.0.0.1', '2018-08-02 10:00:00', '2018-08-02 10:00:00'),
('e3de549c-f4d0-4c5d-8266-a883cfdd4b4b', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 18, 'Ejecución de Planogramas', NULL, '', '1.- Los planogramas tienen la misma ubicación y tamaño que el mapa de Legos de la Tienda.\r\n2.- Los productos colocados como indica la tira de planograma o Promoxxo.\r\n3.- El producto sale libremente al ser tomado por el cliente.\r\n4.- Los productos ubicados en la charola superior no sobrepasan 10cm del límite de altura de la góndola. Para botanas, abarrotes, vinos y bebidas el limite máximo es 20cm de altura.\r\n5.- Los productos colocados al filo de la góndola, parrillas o charolas de exhibidores de piso fijos y acomodados con la marca del producto viendo hacia al frente o vista arriba según sea el caso.\r\n6.- Los productos indicados en la de tira ASLEP están ubicados en charolas de expulsión, exhibidores de remate o mueble definidos por la plaza en piso de venta. Todo articulo que no se pueda colocar deberá tener un folio generado. \r\n7.- Existe el formato de responsable por Lego evaluado correctamente en el corcho operativo. ', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('ea8e206e-a954-4abe-8e52-36d8bf46cf16', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 18, 'Señalizaciones, Utensilios, equipos y habilitadores', 4, NULL, '1.- Se cuenta con toda la señalización (que aplique) de acuerdo al <b>Catálogo</b> de Señalización Institucional en tienda, en buen estado y colocada en los lugares correspondientes (basureros, bodega, caja, comida rápida, cuarto frio, estacionamiento, piso de venta, puerta de acceso y baños).<br><br>\r\n2.- <b>Servicios</b> (lo que aplique en plaza). Colgante de cajeros automáticos en buen estado.<br><br>\r\n3.- Anuncio de <b>tipo de cambio</b> (donde aplique) actualizado, en buen estado y colocado a la vista del cliente.<br><br>\r\n4.- Se cuenta con todos los <b>utensilios, habilitadores y equipos</b> de acuerdo al catálogo institucional y estos se encuentran en buen estado.', 1, 1, NULL, NULL, '2018-10-22 05:00:00', '2018-10-22 05:00:00'),
('ec1839e7-f12b-49af-a425-a371bb84b27c', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 5, 'Manejo de gente', NULL, '- 2XTurno /Nuevo con Líder/ Hora salida/ Vacaciones /Balanceo /Descanso /Plan horario / Alimentación /Cargas de Trabajo/ Tarjeta bancaria', '1.- Contar con mínimo <b>dos empleados por turno</b>, incluyendo al Líder de Tienda.<br><br>\r\n2.- <b>Acompañamiento</b> del Líder de Tienda a empleados nuevos en los primeros 15 días.<br><br>\r\n3.- <b>Salida</b> de turno a tiempo.<br><br>\r\n4.- Cumplir con el rol anual de <b>vacaciones</b>.<br><br>\r\n5.- <b>Balanceo</b> de asignación de tareas (Sem 1 60% ; Sem 2 65% ; Sem 3 70%  y  Sem 4 75%. ) y/o ATA´s <font color=red>especiales</font>.<br><br>\r\n6.- <b>Descanso</b> semanal.<br><br>\r\n7.- <b>Plan horario</b> acordado previo al inicio de la semana, considerando en lo posible temas del personal.  En el corcho y firmado por los empleados. Se cuenta con un tiempo para tomar los alimentos (sin Chaquetín).<br><br>\r\n8.- <font color=red>Se respeta horario establecido para <b>alimentación</b></font>.<br><br>\r\n9.- <b>Cargas de trabajo</b> buscando balance.<br><br>\r\n10.- Se paga a tiempo y completo (tiempos extras, días festivos , etc.), mediante <b>tarjeta bancaria</b> proporcionada por plaza.', 1, 1, NULL, NULL, '2018-11-27 06:00:00', '2018-11-27 06:00:00'),
('edfec3a9-afa8-4d65-8ff7-c4b8231068c2', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 20, 'Calidad del producto (temperatura equipos)', NULL, '', '\"Para mantener la calidad del producto, los equipos deberán colocarse a las siguientes temperaturas:\r\n\r\n1.- Salchichonero a una temperatura de 2 a 6 ºC o 35 a 42 °F. Quesera a una temperatura de 60 a 62 °C o 140 a 145 °F. Refrigerador abierto / Koxka a una temperatura de 2 a 6 ºC o 35 a 42 °F. Vaporera a una temperatura de 60 °C perilla nivel 5. Warmer (si aplica) a una temperatura: 60 a 65 °C; perilla en nivel 4. Roller a una temperatura: 60 a 75 ºC; perilla entre nivel 3 y 4 o entre LOW y MED; Panera equipos APW perilla entre 38 y 65 °C o 100 y 150 °F y  en equipos STAR perilla en el nivel 4.\r\n\"\r\n2.-  Temperatura de la cámara de conservación: \"Refrescos y lácteos\" (2 a 5 ºC) o (36 - 41 °F), cámara de conservación de \"hielo\" (-10 a -7 ºC), cámara fría o \"cervecero\"  (de 0 a 2 °C)  a excepción de las siguientes plazas: (de 2 a 5 ºC)  en Obregón, Nogales, Monterrey, Saltillo, Allende, Laguna, Piedras Negras, Monclova, Culiacán, La Paz, Los Mochis, Reynosa, Laredo, Matamoros y Cd. Juárez. De ( -2 a 0 ) para plaza Mexicali .', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('ee923050-2db4-44cf-84d6-9343f5d7c1b1', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 8, 'Ejecución Fast Food Bebidas', NULL, '', 'Todos los conceptos de fast food bebidas que aplican para la tienda se ejecutan según lo definido en el anexo a estándares fast food.', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00'),
('eecdcbca-1d3a-4292-a640-e86cf734e1d7', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 15, 'Herramienta de Compra /Tablero de Gestión Operativa', 1, NULL, '1.- Se monitorea diariamente las Tiras de PAFS en riesgo de desabasto, Resumen Operativo, Tira de Venta Recuperada por Exhibición y Tira de Venta Perdida Proveedor-Artículo del Tablero de Gestión Operativa, se imprimen y almacenan día / semana anterior y actual en la Carpeta Operativa y se llevan a cabo acciones para disminuirlos. El pedido se hace de acuerdo al sugerido y se aumenta en caso de ser hueco. Stocks actualizados para artículos durante el periodo promocional.  Se almacenan las compras por día y se revisan contra la hoja de arrastre de saldo diario validando compras y devoluciones.', 1, 1, NULL, NULL, '2018-11-27 11:00:00', '2018-11-27 11:00:00'),
('f13898da-1eb4-47c4-89e2-8f38d009bc3c', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 8, 'Calidad y Condiciones del Producto', NULL, '- Limpios/ Frutero/ Caducidad/ Deterioro/ Temperatura de Equipos', '1.- Productos <b>limpios</b> y sin empaques alterados, raspados, o maltratados. (Apto para la venta).<br><br>\r\n2.- Producto en frutero se encuentran en buen estado, limpio, sin daño aparente y acomodado adecuadamente; apto para la venta (no sobremaduro).<br><br>\r\n3.- Producto dentro del límite de <b>caducidad</b> establecido en el mismo (retirar los productos un día antes de la fecha de vencimiento, a menos que tenga la leyenda \"Fresco hasta\") y los más próximos a caducar colocados al frente o más cerca del cliente. Los caducos retirarlos y colocarlos en contenedor de merma (aplica para todos los productos).En los productos que solo contengan la caducidad en mes y año, retirar el último día del mes indicado en de la etiqueta. Retirar los productos perecederos que no tengan etiqueta de caducidad.  Insumos de café y alimentos no caducos.<br><br>\r\n4.- Productos sin <b>señales de deterioro</b> como hongos o resequedad, mal olor o color.<br><br>\r\n5.-  <b>Temperatura de equipos</b>. Cámara de conservación de \"Refrescos y lácteos\" (2 a 5 ºC) o (36 - 41 °F), cámara de conservación de \"hielo\" (-10 a -7 ºC), cámara fría o \"cervecero\"  (de 0 a 2 °C)  a excepción de las siguientes plazas: (de 2 a 5 ºC)  en Obregón, Nogales, Monterrey, Saltillo, Allende, Laguna, Piedras Negras, Monclova, Culiacán, La Paz, Los Mochis, Reynosa, Laredo, Matamoros y Cd. Juárez. De ( -2 a 0 ) para plaza Mexicali . Salchichonero a una temperatura de 2 a 6 ºC o 35 a 42 °F. <font color=red>Para equipos de comida rápida consultar Anexo FF.</font>', 1, 1, NULL, NULL, '2018-10-18 00:00:00', '2018-10-18 00:00:00'),
('f2ec7415-aa76-43b4-bbf7-32c0b2b7f398', 'd168c052-6a0d-4026-8065-f075109740d4', 'E', NULL, NULL, 18, 'Señalizaciones, Utensilios, equipos y habilitadores', 4, NULL, '1.- Se cuenta con toda la señalización (que aplique) de acuerdo al <b>Catálogo</b> de Señalización Institucional en tienda, en buen estado y colocada en los lugares correspondientes (basureros, bodega, caja, comida rápida, cuarto frio, estacionamiento, piso de venta, puerta de acceso y baños).<br><br>\r\n2.- <b>Servicios</b> (lo que aplique en plaza). Colgante de cajeros automáticos en buen estado.<br><br>\r\n3.- Anuncio de <b>tipo de cambio</b> (donde aplique) actualizado, en buen estado y colocado a la vista del cliente.<br><br>\r\n4.- Se cuenta con todos los <b>utensilios, habilitadores y equipos</b> de acuerdo al catálogo institucional y estos se encuentran en buen estado.', 1, 1, NULL, NULL, '2018-11-27 11:00:00', '2018-11-27 11:00:00'),
('fe3b1621-c860-4f4f-994c-04fca06a4919', '13d772fa-826b-424f-802e-63da4777e33c', 'E', NULL, NULL, 7, 'Exhibición', NULL, '- Mapa Legos/ Planograma/  Límite Altura/  Espacios ASLEP/  rotación de productos / Cigarrera/ Hieleras/ Paquetería', '1.- Los <b>planogramas</b> y exhibidores tienen la misma ubicación y tamaño que el <b>mapa de Legos</b> de la Tienda. <font color=red>Los productos colocados como indica la tira de planograma o PROMOXXO, frenteados y fondeados correctamente. En caso de no haber producto, rellenar el hueco con un ASLEP de la misma familia o con  el producto del lado.</font><br><br>\r\n2.- Los productos ubicados en la charola superior no sobrepasan 10cm del <b>límite de altura</b> de la góndola. Para botanas, abarrotes, vinos y bebidas el limite máximo es 20cm de altura.<br><br>\r\n<font color=red>3.- Contar con exhibidores de piso y hieleras acorde a inventario de espacios.</font><br><br>\r\n4.- Los productos indicados en la de tira <b>ASLEP</b> están ubicados en charolas de expulsión, exhibidores de remate o mueble definidos por la plaza en piso de venta. Todo articulo que no se pueda colocar deberá tener un folio generado.<br><br>\r\n5.- La <b>rotación de productos</b> debe de basarse en \"Lo primero que entra es lo primero que sale, \"<b>PEPS</b>\".<br><br>\r\n6.- <b>Cigarrera</b> con producto exhibido en todos sus carriles y con su respectiva comunicación de precios en cada artículo. <font color=red>Cuenta con charola promocional. Carriles y copete en buen estado (si aplica).</font><br><br>\r\n7.- <b>Hieleras</b> con producto de CCM con al menos el 50% de su capacidad, excepto viernes, sábado y domingo que debe de ocupar el 100%, exhibido de acuerdo a guía de acomodo (si aplica).<br><br>\r\n8.-  Artículos de <b>paquetería</b> en tienda colocados en el espacio definido en el checkout (si aplica) y con <font color=red>calcomanía</font> especificada, libre de otras mercancías o utensilios.', 1, 1, NULL, NULL, '2018-10-18 00:00:00', '2018-10-18 00:00:00'),
('ffcce87a-118c-430e-b3d6-6af8cdba3437', '59c3037c-ee96-4bdb-8125-bec8e1c819bc', 'E', NULL, NULL, 16, 'Condiciones del producto', NULL, '', '1.- Productos limpios y sin empaques alterados, raspados, o maltratados. (Apto para la venta).\r\n2.- Producto dentro del límite de caducidad establecido en el mismo (retirar los productos un día antes de la fecha de vencimiento, a menos que tenga la leyenda \"Fresco hasta\") y los más próximos a caducar colocados al frente o más cerca del cliente,  y los caducos retirarlos y colocarlos en contenedor de merma (aplica para todos los productos). En los productos que solo contengan la caducidad en mes y año, retirar el último día del mes indicado en de la etiqueta. Retirar los productos perecederos que no tengan etiqueta de caducidad.\r\n3.- Productos (comida rápida) sin señales de deterioro como hongos o resequedad, mal olor o color.\r\n4.- Insumos de café y alimentos no caducos.', 1, 1, NULL, '127.0.0.1', '2018-08-10 05:00:00', '2018-08-10 05:00:00');
